script: |
  super -f text -I q4546.spq | sort > q4546.out

inputs:
  - name: q4546.spq
    data: |
      SELECT DISTINCT - ( 92 ) * + col2 AS col1 FROM tab2 (FORMAT parquet) WHERE 68 * col1 + col0 / col0 NOT BETWEEN - 45 AND - 0 / col0;
  - name: tab2

outputs:
  - name: q4546.out
    data: |
      -2116
      -3680
      -5336
